//한 종목에 대한 데이터 구조체
struct Stock: Codable{
    var stockName: String
    var stockCode: String
    var currentPrice: Double
    var change: Double
    var changePercentage: Double
    
    var newsUrl: String //MK
    var magazineUrl: String //한경
    var economistUrl: String //이코노미스트
    
    var predict5_date: [String]
    var predict5_price: [Double]
    
    var predict10_date: [String]
    var predict10_price: [Double]
}

//한 종목에 대한 데이터 구조체
struct Stock_Dummy{
    var stockName: String
    var stockCode: String
    var currentPrice: Double
    var change: Double
    var changePercentage: Double
    
    var dayFivePrices: [[Date:Double]]
    var dayTenPrices: [[Date:Double]]
    var Prices: [[Date:Double]]
    
    var newsUrl: String //MK
    var magazineUrl: String //한경
    var economistUrl: String //이코노미스트
}

//한 종목에 대한 데이터 구조체
struct PredictStock: Codable{
    var stockName: String
    var stockCode: String
    var currentPrice: Double
    var change: Double
    var changePercentage: Double
    
    var newsUrl: String //MK
    var magazineUrl: String //한경
    var economistUrl: String //이코노미스트
    
