    var predict10_Data: [[Double:String]]
    var current_Data: [[Double:String]]
}


//현재까지의 종가를 가져오기 위한 모델
struct Chart: Codable {
    let result: [Result]
}

struct Result: Codable {
    let indicators: Quote
}
    
struct Quote: Codable {
    let close: [Double]
}
    
//현재까지의 종가를 가져오기 위한 모델
struct StockChartResponse: Codable {
    struct Chart: Codable {
        struct Quote: Codable {
            let close: [Double]
        }
        let result: [Result]
    }
    
    struct Result: Codable {
        let indicators: Quote
    }
    
    let chart: Chart
}

//현재까지의 종가를 가져오기 위한 모델
struct StockDataResponse: Codable {
    struct ChartResult: Codable {
        struct MetaData: Codable {
            let currency: String
            let symbol: String
            let exchangeName: String
            let instrumentType: String
            let firstTradeDate: TimeInterval
            let regularMarketTime: TimeInterval
            let gmtoffset: TimeInterval
            let timezone: String
            let exchangeTimezoneName: String
            let regularMarketPrice: Double
            let chartPreviousClose: Double
            let previousClose: Double
            let scale: Int
            let priceHint: Int
            struct CurrentTradingPeriod: Codable {
                let pre: MarketPeriod
                let regular: MarketPeriod
                let post: MarketPeriod
            }
            struct MarketPeriod: Codable {
                let timezone: String
                let start: TimeInterval
                let end: TimeInterval
                let gmtoffset: TimeInterval
            }
            let currentTradingPeriod: CurrentTradingPeriod
            let tradingPeriods: [[MarketPeriod]]
            let dataGranularity: String
            let range: String
            let validRanges: [String]
        }
        
        struct Indicator: Codable {
            let quote: Quote
        }
        
        struct Quote: Codable {
            let close: [Double]
            let volume: [Int]
            let high: [Double]
            let open: [Double]
        }
        
        let meta: MetaData
        let timestamp: [TimeInterval]
        let indicators: Indicator
    }
    
    let chart: ChartResult
    let error: String?
}








